import PaintingList from "./PaintingList"
import { useState } from "react";
import painting1 from './images/painting1.jpeg'
import painting2 from './images/painting2.jpg'
import painting3 from './images/painting3.jpg'
import painting4 from './images/painting4.png'
import painting5 from './images/painting5.jpg'
import painting6 from './images/painting6.jpg'
import painting7 from './images/painting7.jpg'



const Home = () => {

    const [paintings, setPaintings] = useState([
        { title: 'Starry Night', source: painting1, author: 'Van Gogh', genre: 'Impressionist', id: 1 },
        { title: 'Cool Castle', source: painting2, author: 'My Buddy Eric', genre: 'Impressionist', id: 2 },
        { title: 'Christmas!', source: painting3, author: 'someone', genre: 'Impressionist', id: 3 },
        { title: 'Sleepy', source: painting4, author: 'Inigo Montoya', genre: 'Impressionist', id: 4 },
        { title: 'Autumn Promenade', source: painting5, author: 'Jean Paul-Sartre', genre: 'Impressionist', id: 5 },
        { title: 'Mountain', source: painting6, author: 'Gustave', genre: 'Impressionist', id: 6 },
        { title: 'Space Odyssey', source: painting7, author: 'Dave', genre: 'Impressionist', id: 7 }
      ]);

    return ( 
        <div className="home">

            <PaintingList paintings={paintings} title="Paintings" />
        </div>
     );
}

export default Home;
